bd7-8f8c-217c2e7b20a2?t=1352102285354\" style=\"width: 226px; height: 169px;\" /></a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/freightplus\"><img alt=\"\" src=\"/documents/10180/0/FreightPlusThumb.png/a18e0ca0-5463-4728-8702-b781ec03b6b4?t=1352102285293\" style=\"width: 226px; height: 155px;\" /></a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/motorplus\"><img alt=\"\" src=\"/documents/10180/0/MotorPlusThumb.png/64bf813d-007a-49e6-9aad-8100b072d860?t=1352102283000\" style=\"width: 226px; height: 168px;\" /></a></td>\n							</tr>\n							<tr>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/lifeplus\" target=\"_blank\">Life Plus</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/irishbrokerpi\">Irish Broker PI</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/equineplus\" target=\"_blank\">Equine Plus</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/freightplus\">FreightPlus</a></td>\n								<td align=\"center\" valign=\"top\">\n									<a href=\"/web/motorplus\" target=\"_blank\">Motor Plus</a></td>\n							</tr>\n							<tr>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A simple product based on Term Life. This is a good place to start learning the concepts of OpenQuote.</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A product built in conjunction with <a href=\"http://www.citynet.org.uk\">City Net</a> a London City broker. Most of the portal is open access, but to see the quotation tab you will need to login as <strong>broker</strong> (password also \'broker\').</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										Private horse insurance product offering cover for riding equipment and the horse.</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A personal freight shipping product. This product quotes based on just four question.</p>\n								</td>\n								<td align=\"center\" class=\"portlet-dim\" valign=\"top\">\n									<p>\n										A reasonably complex personal motor product. Offers support for multiple drivers and multiple vehicles with four pages of rating questions in total.</p>\n								</td>\n							</tr>\n						</tbody>\n					</table>\n				</div>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				&nbsp;</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"5\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Product management</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"4\">\n				<p>\n					You can also modify any feature of a product or create completely new products, all from this portal.&nbsp; To access these features, simply login as a product developer. We\'ve included a demo user: <strong>developer@openquote.local</strong> (password also \'<strong>developer</strong>\'), so you can try these features out.</p>\n				<p>\n					Click the Login link on the top right of this page to get started.</p>\n			</td>\n			<td align=\"center\">\n				<a href=\"/documents/10180/0/pdf.png/138cbb3c-48b8-4e5c-8c1f-068b5b749ec1?t=1352742340424\" target=\"_blank\"> <img align=\"middle\" alt=\"pdf icon\" src=\"/documents/10180/0/pdf.png/138cbb3c-48b8-4e5c-8c1f-068b5b749ec1?t=1352742340424\" style=\"width: 32px; height: 32px;\" title=\"pdf icon\" /><br />\n				Product<br />\n				management<br />\n				user guide </a></td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				&nbsp;</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"5\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Administration</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				<p>\n					If you would like to see more of the internals of the portal itself, we\'ve also included a demo administration user: <strong>admin@openquote.local</strong> (password \'<strong>admin</strong>\'). Logging in as this user gives you control over the portal itself - you can add/remove users, administer windows, pages, or even create completely new portals.</p>\n				<p align=\"left\">\n					Login from the link on the top right of this page.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>]]></static-content>\n</root>','general','','','','2012-11-05 07:43:00',NULL,NULL,1,0,11009,'',0,10406,'OpenQuote Admin','2013-04-12 17:02:00'),('f06a0d4a-752d-4ff0-899b-afe0fb9c079b',22710,11008,10180,10154,10406,'OpenQuote Admin','2013-04-15 12:11:36','2013-04-15 12:11:36',0,0,'11006',2.2,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_US\" default-locale=\"en_US\"><Title language-id=\"en_US\">Welcome to OpenQuote</Title></root>','welcome-to-openquote','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_US\" default-locale=\"en_US\">\n	<static-content language-id=\"en_US\"><![CDATA[<table border=\"0\" width=\"100%\">\n	<tbody>\n		<tr align=\"left\">\n			<td colspan=\"6\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Welcome to OpenQuote</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				<p>\n					OpenQuote is the Open Source solution for providing insurance quotations over the web. Using a web interface, insurance companies can define any number of products or schemes to support any line of business. These can then be made instantly available for quotation to any proposer or other insurance intermediary who has web access.</p>\n				<p>\n					OpenQuote is Open Source; distributed under the <a href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU General Public License</a>. This means you can download it and use it freely without charge - as long as you comply with the license. <a href=\"http://www.appliedindustriallogic.com/\" target=\"_blank\">Applied Industrial Logic</a> - the original developers of OpenQuote -&nbsp; offer comprehensive commercial support and consultancy services should you require them, but you are not obliged to use them.</p>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				&nbsp;</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"5\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Try a sample product</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				<p>\n					OpenQuote comes with a number of pre-built sample products to give a feel for its capabilities. You can get try these right now by clicking the links below. The full product definitions and all of the supporting resources are also included and can be found in the Product Manager (see below).</p>\n			</td>\n		</tr>\n		<tr>\n			<td align=\"center\" colspan=\"5\">\n				<div style=\"width: 800px; overflow-x: auto; overflow-y: hidden; border: 1px solid #98b7c6; font-size: 0.85em; line-height: 1.5;\">\n					<table border=\"0\">\n						<tbody>\n							<tr>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/lifeplus\"><img alt=\"\" src=\"/documents/10180/0/LifePlusThumb.png/4df44eb7-b84c-4470-9860-3148d0628405?t=1352102285147\" style=\"width: 226px; height: 169px;\" /></a><a href=\"/portal/portal/Life%20Plus\" target=\"_blank\"> </a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/irishbrokerpi\"><img alt=\"\" src=\"/documents/10180/0/IrishBrokerPIThumb.png/44484f2e-a3c3-426c-aef6-71eaf9d7cf1f?t=1352102285234\" style=\"width: 226px; height: 214px;\" /></a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/equineplus\"><img alt=\"\" src=\"/documents/10180/0/EquinePlusThumb.png/c6d66ea7-2dcf-4bd7-8f8c-217c2e7b20a2?t=1352102285354\" style=\"width: 226px; height: 169px;\" /></a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/freightplus\"><img alt=\"\" src=\"/documents/10180/0/FreightPlusThumb.png/a18e0ca0-5463-4728-8702-b781ec03b6b4?t=1352102285293\" style=\"width: 226px; height: 155px;\" /></a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/motorplus\"><img alt=\"\" src=\"/documents/10180/0/MotorPlusThumb.png/64bf813d-007a-49e6-9aad-8100b072d860?t=1352102283000\" style=\"width: 226px; height: 168px;\" /></a></td>\n							</tr>\n							<tr>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/lifeplus\" target=\"_blank\">Life Plus</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/irishbrokerpi\">Irish Broker PI</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/equineplus\" target=\"_blank\">Equine Plus</a></td>\n								<td align=\"center\" valign=\"top\">\n									&nbsp;<a href=\"/web/freightplus\">FreightPlus</a></td>\n								<td align=\"center\" valign=\"top\">\n									<a href=\"/web/motorplus\" target=\"_blank\">Motor Plus</a></td>\n							</tr>\n							<tr>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A simple product based on Term Life. This is a good place to start learning the concepts of OpenQuote.</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A product built in conjunction with <a href=\"http://www.citynet.org.uk\">City Net</a> a London City broker. Most of the portal is open access, but to see the quotation tab you will need to login as <strong>broker</strong> (password also \'broker\').</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										Private horse insurance product offering cover for riding equipment and the horse.</p>\n								</td>\n								<td align=\"center\" valign=\"top\">\n									<p>\n										A personal freight shipping product. This product quotes based on just four question.</p>\n								</td>\n								<td align=\"center\" class=\"portlet-dim\" valign=\"top\">\n									<p>\n										A reasonably complex personal motor product. Offers support for multiple drivers and multiple vehicles with four pages of rating questions in total.</p>\n								</td>\n							</tr>\n						</tbody>\n					</table>\n				</div>\n			</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				&nbsp;</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"5\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Product management</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"4\">\n				<p>\n					You can also modify any feature of a product or create completely new products, all from this portal.&nbsp; To access these features, simply login as a product developer. We\'ve included a demo user: <strong>developer@openquote.local</strong> (password also \'<strong>developer</strong>\'), so you can try these features out.</p>\n				<p>\n					Click the Login link on the top right of this page to get started.</p>\n			</td>\n			<td align=\"center\">\n				<a href=\"/documents/10180/0/pdf.png/138cbb3c-48b8-4e5c-8c1f-068b5b749ec1?t=1352742340424\" target=\"_blank\"> <img align=\"middle\" alt=\"pdf icon\" src=\"/documents/10180/0/pdf.png/138cbb3c-48b8-4e5c-8c1f-068b5b749ec1?t=1352742340424\" style=\"width: 32px; height: 32px;\" title=\"pdf icon\" /><br />\n				Product<br />\n				management<br />\n				user guide </a></td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				&nbsp;</td>\n		</tr>\n		<tr align=\"left\">\n			<td colspan=\"5\" style=\"border-style: none none solid; border-color: #98b7c6; border-width: 1px\">\n				Administration</td>\n		</tr>\n		<tr>\n			<td colspan=\"5\">\n				<p>\n					If you would like to see more of the internals of the portal itself, we\'ve also included a demo administration user: <strong>admin@openquote.local</strong> (password \'<strong>admin</strong>\'). Logging in as this user gives you control over the portal itself - you can add/remove users, administer windows, pages, or even create completely new portals.</p>\n				<p align=\"left\">\n					Login from the link on the top right of this page.</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>]]></static-content>\n</root>','general','','','','2012-11-05 07:43:00',NULL,NULL,1,0,11009,'',0,10406,'OpenQuote Admin','2013-04-15 12:11:36'),('3a63da81-c488-4608-8335-2347f6346917',52726,52727,48407,10154,10406,'OpenQuote Admin','2013-09-01 21:24:09','2013-09-01 21:35:38',0,0,'52725',1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Welcome to OpenUnderwriter</Title></root>','welcome-to-openunderwriter','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<p>\n	Welcome to OpenUnderwriter. OpenUnderwriter is an open source insurance solution created by <a href=\"http://www.appliedindustriallogic.com\">Applied Industrial Logic</a>. OpenUnderwriter is made up of OpenQuote, OpenActuary, OpenPolicy and OpenClaim. Each is desgined to be used either independently or integrated as part of a complete insurance solution. Use the links below to access the different areas of OpenUnderwriter.</p>\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"3\" style=\"width: 500px; \">\n	<tbody>\n		<tr>\n			<td style=\"text-align: center; \">\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenActuary+h30px.png/07d872ce-709b-44cf-808f-b13b676d8cd0?t=1378070722398\" style=\"width: 188px; height: 30px; \" /></td>\n			<td style=\"text-align: center; \">\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenQuote+h30px.png/79f595a0-f976-473a-b6d9-f53380601042?t=1378070722910\" style=\"width: 162px; height: 30px; \" /></td>\n			<td>\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenPolicy+h30px.png/c7e8b00a-ef4b-4e98-98f8-0c79f9fb449d?t=1378070722801\" style=\"width: 164px; height: 30px; \" /></td>\n			<td>\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenClaim+h30px.png/b2737c9b-f852-48f9-b65f-2b8072893e01?t=1378070722488\" style=\"width: 157px; height: 30px; \" /></td>\n		</tr>\n		<tr>\n			<td style=\"text-align: center; \">\n				An Actuarial Research Data Repository (ARDR) with&nbsp;data import, export and reporting functionality.&nbsp;Providing industry and insurer data for analysis.</td>\n			<td style=\"text-align: center; \">\n				A policy distribution tool, allowing insurance products to be delivered electronically. Includes premium transactions.</td>\n			<td style=\"text-align: center; \">\n				A policy management tool, allowing live policies to be managed. Including endoresements, renewals and canellations.&nbsp;</td>\n			<td style=\"text-align: center; \">\n				A Claims management tool, allowing claims to be submitted, processed and paid. Currently concept only.</td>\n		</tr>\n	</tbody>\n</table>\n<p>\n	&nbsp;</p>\n<p>\n	OpenUnderwriter is distributed under the <a href=\"http://opensource.org/licenses/gpl-3.0.html\" target=\"_blank\">GNU General Public License</a>. This means you can download it and use it freely without charge as long as you comply with the license. Applied Industrial Logic - the original developers of OpenQuote - offer comprehensive commercial support and consultancy services should you require them, but you are not obliged to use them.</p>]]></static-content>\n</root>','general','','','','2013-09-01 21:04:00',NULL,NULL,1,0,52728,'',0,10406,'OpenQuote Admin','2013-09-01 21:35:38'),('e8909c8d-5929-41a5-a0bc-ef53b78aadc7',53006,52727,48407,10154,10406,'OpenQuote Admin','2013-09-01 21:38:55','2013-09-01 21:38:55',0,0,'52725',1.1,'<?xml version=\'1.0\' encoding=\'UTF-8\'?><root available-locales=\"en_GB\" default-locale=\"en_GB\"><Title language-id=\"en_GB\">Welcome to OpenUnderwriter</Title></root>','welcome-to-openunderwriter','','<?xml version=\"1.0\"?>\n\n<root available-locales=\"en_GB\" default-locale=\"en_GB\">\n	<static-content language-id=\"en_GB\"><![CDATA[<p>\n	Welcome to OpenUnderwriter. OpenUnderwriter is an open source insurance solution created by <a href=\"http://www.appliedindustriallogic.com\">Applied Industrial Logic</a>. OpenUnderwriter is made up of OpenQuote, OpenActuary, OpenPolicy and OpenClaim. Each is desgined to be used either independently or integrated as part of a complete insurance solution. Use the links below to access the different areas of OpenUnderwriter.</p>\n<table align=\"center\" border=\"0\" cellpadding=\"1\" cellspacing=\"3\" style=\"width: 80%; \">\n	<tbody>\n		<tr>\n			<td style=\"text-align: center; \">\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenActuary+h30px.png/07d872ce-709b-44cf-808f-b13b676d8cd0?t=1378070722398\" style=\"width: 188px; height: 30px; margin: 8px; \" /></td>\n			<td style=\"text-align: center; \">\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenQuote+h30px.png/79f595a0-f976-473a-b6d9-f53380601042?t=1378070722910\" style=\"width: 162px; height: 30px; margin: 8px; \" /></td>\n			<td>\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenPolicy+h30px.png/c7e8b00a-ef4b-4e98-98f8-0c79f9fb449d?t=1378070722801\" style=\"width: 164px; height: 30px; margin: 8px; \" /></td>\n			<td>\n				<img alt=\"\" src=\"/documents/48407/52723/logo+png+OpenClaim+h30px.png/b2737c9b-f852-48f9-b65f-2b8072893e01?t=1378070722488\" style=\"width: 157px; height: 30px; margin: 8px; \" /></td>\n		</tr>\n		<tr>\n			<td style=\"text-align: center; \">\n				An Actuarial Research Data Repository (ARDR) with&nbsp;data import, export and reporting functionality.&nbsp;Providing industry and insurer data for analysis.</td>\n			<td style=\"text-align: center; \">\n				A policy distribution tool, allowing insurance products to be delivered electronically. Includes premium transactions.</td>\n			<td style=\"text-align: center; \">\n				A policy management tool, allowing live policies to be managed. Including endoresements, renewals and canellations.&nbsp;</td>\n			<td style=\"text-align: center; \">\n				A Claims management tool, allowing c